giH(){return"\u0c15\u0c4d\u0c30\u0c3e\u0c38\u0c4d-\u0c2b\u0c47\u0c21\u0c3f\u0c02\u0c17\u0c4d \u0c35\u0c40\u0c15\u0c4d\u0c37\u0c23\u0c32\u0c24\u0c4b \u0c15\u0c3f\u0c02\u0c26\u0c3f\u0c35\u0c48\u0c2a\u0c41 \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c37\u0c28\u0c4d"},
gcr(){return"\u0c38\u0c4d\u0c25\u0c3f\u0c30\u0c2e\u0c48\u0c28 \u0c32\u0c47\u0c2c\u0c41\u0c33\u0c4d\u0c32\u0c41"},
gcs(){return"\u0c32\u0c47\u0c2c\u0c41\u0c32\u0c4d \u0c0e\u0c02\u0c1a\u0c41\u0c15\u0c4b\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f"},
gcq(){return"\u0c15\u0c3f\u0c02\u0c26\u0c3f\u0c15\u0c3f \u0c09\u0c02\u0c21\u0c47 \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c37\u0c28\u0c4d \u0c2c\u0c3e\u0c30\u0c4d\u200c\u0c32\u0c41 \u0c38\u0c4d\u0c15\u0c4d\u0c30\u0c40\u0c28\u0c4d \u0c26\u0c3f\u0c17\u0c41\u0c35\u0c41\u0c28 \u0c2e\u0c42\u0c21\u0c41 \u0c28\u0c41\u0c02\u0c21\u0c3f \u0c10\u0c26\u0c41 \u0c17\u0c2e\u0c4d\u0c2f\u0c38\u0c4d\u0c25\u0c3e\u0c28\u0c3e\u0c32\u0c28\u0c41 \u0c2a\u0c4d\u0c30\u0c26\u0c30\u0c4d\u0c36\u0c3f\u0c38\u0c4d\u0c24\u0c3e\u0c2f\u0c3f. \u0c2a\u0c4d\u0c30\u0c24\u0c3f \u0c17\u0c2e\u0c4d\u0c2f\u0c38\u0c4d\u0c25\u0c3e\u0c28\u0c02 \u0c12\u0c15 \u0c1a\u0c3f\u0c39\u0c4d\u0c28\u0c02, \u0c05\u0c32\u0c3e\u0c17\u0c47 \u0c10\u0c1a\u0c4d\u0c1b\u0c3f\u0c15 \u0c35\u0c1a\u0c28 \u0c32\u0c47\u0c2c\u0c41\u0c32\u0c4d \u0c06\u0c27\u0c3e\u0c30\u0c02\u0c17\u0c3e \u0c38\u0c42\u0c1a\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c4d\u0c21\u0c3e\u0c2f\u0c3f. \u0c15\u0c3f\u0c02\u0c26\u0c3f\u0c15\u0c3f \u0c09\u0c02\u0c21\u0c47 \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c37\u0c28\u0c4d \u0c1a\u0c3f\u0c39\u0c4d\u0c28\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c3f\u0c28\u0c2a\u0c4d\u0c2a\u0c41\u0c21\u0c41, \u0c2f\u0c42\u0c1c\u0c30\u0c4d \u0c06 \u0c1a\u0c3f\u0c39\u0c4d\u0c28\u0c02\u0c24\u0c4b \u0c05\u0c28\u0c41\u0c2c\u0c02\u0c27\u0c3f\u0c24\u0c2e\u0c48\u0c28 \u0c05\u0c24\u0c4d\u0c2f\u0c02\u0c24 \u0c2a\u0c4d\u0c30\u0c27\u0c3e\u0c28\u0c2e\u0c48\u0c28 \u0c17\u0c2e\u0c4d\u0c2f\u0c38\u0c4d\u0c25\u0c3e\u0c28\u0c02 \u0c09\u0c28\u0c4d\u0c28 \u0c28\u0c3e\u0c35\u0c3f\u0c17\u0c47\u0c37\u0c28\u0c4d\u200c\u0c15\u0c41 \u0c24\u0c40\u0c38\u0c41\u0c15\u0c46\u0c33\u0c4d\u0c32\u0c2c\u0c21\u0c24\u0c3e\u0c30\u0c41."},
giQ(){return"\u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41"},
giP(){return"\u0c1f\u0c46\u0c15\u0c4d\u0c38\u0c4d\u0c1f\u0c4d, \u0c2e\u0c41\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c09\u0c28\u0c4d\u0c28, \u0c30\u0c42\u0c2a\u0c15\u0c32\u0c4d\u0c2a\u0c28 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41, \u0c07\u0c02\u0c15\u0c3e \u0c2e\u0c30\u0c46\u0c28\u0c4d\u0c28\u0c4b"},
gdq(){return"\u0c1f\u0c46\u0c15\u0c4d\u0c38\u0c4d\u0c1f\u0c4d \u0c2c\u0c1f\u0c28\u0c4d"},
glZ(){return"\u0c1f\u0c46\u0c15\u0c4d\u0c38\u0c4d\u0c1f\u0c4d \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c28\u0c41 \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c3f\u0c24\u0c47, \u0c05\u0c26\u0c3f \u0c07\u0c02\u0c15\u0c4d \u0c1a\u0c32\u0c4d\u0c32\u0c3f\u0c28\u0c1f\u0c4d\u0c1f\u0c41\u0c17\u0c3e \u0c2a\u0c4d\u0c30\u0c26\u0c30\u0c4d\u0c36\u0c3f\u0c38\u0c4d\u0c24\u0c41\u0c02\u0c26\u0c3f, \u0c15\u0c3e\u0c28\u0c40 \u0c0e\u0c24\u0c4d\u0c24\u0c26\u0c41. \u0c1f\u0c42\u0c32\u0c4d\u200c\u0c2c\u0c3e\u0c30\u0c4d\u200c\u0c32\u0c32\u0c4b, \u0c21\u0c48\u0c32\u0c3e\u0c17\u0c4d\u200c\u0c32\u0c32\u0c4b, '\u0c2a\u0c4d\u0c2f\u0c3e\u0c21\u0c3f\u0c02\u0c17\u0c4d\u200c\u0c24\u0c4b \u0c07\u0c28\u0c4d\u200c\u0c32\u0c48\u0c28\u0c4d\u200c\u0c32\u0c4b' \u0c1f\u0c46\u0c15\u0c4d\u0c38\u0c4d\u0c1f\u0c4d \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c09\u0c2a\u0c2f\u0c4b\u0c17\u0c3f\u0c02\u0c1a\u0c02\u0c21\u0c3f"},
gcM(){return"\u0c2e\u0c41\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d"},
gjV(){return"\u0c2e\u0c41\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41 \u0c0e\u0c15\u0c4d\u0c15\u0c41\u0c35\u0c17\u0c3e \u0c2b\u0c4d\u0c32\u0c3e\u0c1f\u0c4d \u0c32\u0c47\u0c05\u0c35\u0c41\u0c1f\u0c4d\u200c\u0c32\u0c15\u0c41 \u0c2d\u0c41\u0c1c\u0c3e\u0c28\u0c4d\u0c28\u0c3f \u0c1c\u0c4b\u0c21\u0c3f\u0c38\u0c4d\u0c24\u0c3e\u0c2f\u0c3f. \u0c05\u0c35\u0c3f \u0c2c\u0c3f\u0c1c\u0c40\u0c17\u0c3e \u0c32\u0c47\u0c26\u0c3e \u0c35\u0c3f\u0c38\u0c4d\u0c24\u0c43\u0c24\u0c02\u0c17\u0c3e \u0c09\u0c28\u0c4d\u0c28 \u0c2a\u0c4d\u0c30\u0c26\u0c47\u0c36\u0c3e\u0c32\u0c32\u0c4b \u0c35\u0c3f\u0c27\u0c41\u0c32\u0c28\u0c41 \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c3f \u0c1a\u0c46\u0c2c\u0c41\u0c24\u0c3e\u0c2f\u0c3f."},
gdc(){return"\u0c30\u0c42\u0c2a\u0c15\u0c32\u0c4d\u0c2a\u0c28 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d"},
gkP(){return"\u0c30\u0c42\u0c2a\u0c15\u0c32\u0c4d\u0c2a\u0c28 \u0c09\u0c28\u0c4d\u0c28 \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41 \u0c05\u0c2a\u0c3e\u0c30\u0c26\u0c30\u0c4d\u0c36\u0c15\u0c02\u0c17\u0c3e \u0c2e\u0c3e\u0c30\u0c24\u0c3e\u0c2f\u0c3f, \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c3f\u0c28\u0c2a\u0c4d\u0c2a\u0c41\u0c21\u0c41 \u0c2a\u0c4d\u0c30\u0c15\u0c3e\u0c36\u0c35\u0c02\u0c24\u0c02 \u0c05\u0c35\u0c41\u0c24\u0c3e\u0c2f\u0c3f. \u0c2a\u0c4d\u0c30\u0c24\u0c4d\u0c2f\u0c3e\u0c2e\u0c4d\u0c28\u0c3e\u0c2f, \u0c26\u0c4d\u0c35\u0c3f\u0c24\u0c40\u0c2f \u0c1a\u0c30\u0c4d\u0c2f\u0c28\u0c41 \u0c38\u0c42\u0c1a\u0c3f\u0c02\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c05\u0c35\u0c3f \u0c24\u0c30\u0c1a\u0c41\u0c17\u0c3e \u0c2e\u0c41\u0c02\u0c26\u0c41\u0c15\u0c41 \u0c35\u0c1a\u0c4d\u0c1a\u0c3f\u0c28 \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c24\u0c4b \u0c2a\u0c46\u0c2f\u0c3f\u0c30\u0c4d \u0c1a\u0c47\u0c2f\u0c2c\u0c21\u0c24\u0c3e\u0c2f\u0c3f."},
gdt(){return"\u0c1f\u0c4b\u0c17\u0c41\u0c32\u0c4d \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c41"},
gmp(){return"\u0c38\u0c02\u0c2c\u0c02\u0c27\u0c3f\u0c24 \u0c0e\u0c02\u0c2a\u0c3f\u0c15\u0c32\u0c28\u0c41 \u0c38\u0c2e\u0c42\u0c39\u0c2a\u0c30\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c1f\u0c4b\u0c17\u0c41\u0c32\u0c4d \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c09\u0c2a\u0c2f\u0c4b\u0c17\u0c3f\u0c02\u0c1a\u0c35\u0c1a\u0c4d\u0c1a\u0c41. \u0c38\u0c02\u0c2c\u0c02\u0c27\u0c3f\u0c24 \u0c1f\u0c4b\u0c17\u0c41\u0c32\u0c4d \u0c2c\u0c1f\u0c28\u0c4d\u200c\u0c32 \u0c17\u0c4d\u0c30\u0c42\u0c2a\u0c4d\u200c\u0c32\u0c28\u0c41 \u0c28\u0c4a\u0c15\u0c4d\u0c15\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f, \u0c17\u0c4d\u0c30\u0c42\u0c2a\u0c4d\u200c \u0c38\u0c3e\u0c27\u0c3e\u0c30\u0c23 \u0c15\u0c02\u0c1f\u0c48\u0c28\u0c30\u0c4d\u200c\u0c28\u0c3f \u0c37\u0c47\u0c30\u0c4d \u0c1a\u0c47\u0c2f\u0c3e\u0c32\u0c3f"},
gbv(){return"\u0c24\u0c47\u0c32\u0c3f\u0c2f\u0c3e\u0c21\u0c47 \u0c1a\u0c30\u0c4d\u0c2f \u0c2c\u0c1f\u0c28\u0c4d"},
gkd(){return"\u0c2b\u0c4d\u0c32\u0c4b\u0c1f\u0c3f\u0c02\u0c17\u0c4d \u0c2f\u0c3e\u0c15\u0c4d\u0c37\u0c28\u0c4d \u0c2c\u0c1f\u0c28\u0c4d \u0c05\u0c28\u0c47\u0c26\u0c3f \u0c35\u0c43\u0c24\u0c4d\u0c24\u0c3e\u0c15\u0c3e\u0c30 \u0c10\u0c15\u0c3e\u0c28\u0c4d \u0c2c\u0c1f\u0c28\u0c4d. \u0c15\u0c02\u0c1f\u0c46\u0c02\u0c1f\u0c4d\u200c\u0c2a\u0c48 \u0c2e\u0c4c\u0c38\u0c4d \u0c15\u0c30\u0c4d\u0c38\u0c30\u0c4d\u200c\u0c28\u0c41 \u0c09\u0c02\u0c1a\u0c3f\u0c28\u0c2a\u0c4d\u0c2a\u0c41\u0c21\u0c41 \u0c07\u0c26\u0c3f \u0c15\u0c28\u0c2a\u0c21\u0c41\u0c24\u0c41\u0c02\u0c26\u0c3f, \u0c2f\u0c3e\u0c2a\u0c4d\u200c\u0c32\u0c4b \u0c2a\u0c4d\u0c30\u0c3e\u0c25\u0c2e\u0c3f\u0c15 \u0c1a\u0c30\u0c4d\u0c2f\u0c28\u0c41 \u0c2a\u0c4d\u0c30\u0c4b\u0c24\u0c4d\u0c38\u0c39\u0c3f\u0c02\u0c1a\u0c21\u0c3e\u0c28\u0c3f\u0c15\u0c3f \u0c08 \u0c2c\u0c1f\u0c28\u0c4d \u0c09\u0c26\u0c4d\u0c26\u0c47\u0c36\u0c3f\u0c02\u0c1a\u0c2c\u0c21\u0c3f\u0c02\u0c26\u0c3f."},
gbh(){return"\u0c15\u0c3e\u0c30\u0c4d\u0c21\u0c4d\u200c\u0c32\u0c41"},
